	checkSelection : function (coord) {
		var sheet = this.sheet,
		store = sheet.getStore(),
		sm = sheet.getSelectionModel();
		coord = coord || sm.selection2Coord(),
		span = coord[0];
		if (0 == span[1] && 0 == span[2]) {
			return "whole"
		} else {
			var sheetId = span[0],
			minrow = span[1],
			maxrow = span[3],
			mincol = span[2],
			maxcol = span[4];
			if (0 == maxrow) {
				var flag = true,
				hasTpl = false;
				store.walkRange(coord, function (rd) {
					var property = store.getCellProperty(rd.data.sheet, rd.data.row, rd.data.col);
					if (property.tpl) {
						hasTpl = true;
						var tpl = Ext.decode(property.tpl);
						var span = tpl.span;
						if (!((mincol > span[2] && maxcol < span[4]) || maxcol < span[2] || mincol > span[4])) {
							flag = false;
							return false
						}
					}
				}, this);
				if (flag) {
					return hasTpl ? "all" : "none"
				} else {
					return "part"
				}
			} else {
				if (0 == maxcol) {
					var flag = true,
					hasTpl = false;
					store.walkRange(coord, function (rd) {
						var property = store.getCellProperty(rd.data.sheet, rd.data.row, rd.data.col);
						if (property.tpl) {
							hasTpl = true;
							var tpl = Ext.decode(property.tpl);
							var span = tpl.span;
							if (!((minrow > span[1] && maxrow < span[3]) || maxrow < span[1] || minrow > span[3])) {
								flag = false;
								return false
							}
						}
					}, this);
					if (flag) {
						return hasTpl ? "all" : "none"
					} else {
						return "part"
					}
				} else {
					var tplCount = 0,
					sum = 0;
					store.walkRange(coord, function (rd) {
						var property = store.getCellProperty(rd.data.sheet, rd.data.row, rd.data.col);
						if (property.tpl) {
							tplCount++
						}
						sum++
					}, this);
					if (0 === tplCount) {
						return "none"
					} else {
						if (tplCount == sum) {
							return "all"
						} else {
							return "part"
						}
					}
				}
			}
		}
	},
