		var maxrow = insertRow + rowSpan;
		var cols = [];
		store.each(function (rd) {
			var row = rd.data.row,
			col = rd.data.col,
			json = rd.data.json;
			if (sheetId == rd.data.sheet && 0 != row && maxrow == row && json.tpl) {
				var tpl = Ext.decode(json.tpl);
				var span = tpl.span;
				var top = span[1],
				bottom = span[3];
				if (top < maxrow) {
					cols.push([col, tpl, top, bottom])
				}
			}
		}, this);
		for (var i = 0, len = cols.length; i < len; i++) {
			var c = cols[i];
			var col = c[0],
			tpl = c[1],
			top = c[2],
			bottom = c[3];
			for (var row = insertRow; row < maxrow; row++) {
				tpl.span[1] = top;
				tpl.span[3] = bottom;
				store.setCell(sheetId, row, col, {
					tpl : Ext.encode(tpl)
				}, null, true)
			}
		}
