	countCell : function () {
		var sum = 0;
		var r = this.cregion;
		sum += (r.rowEnd - r.rowStart + 1) * (r.colEnd - r.colStart + 1);
		if (this.tregion.isVisible()) {
			r = this.tregion;
			sum += (r.rowEnd - r.rowStart + 1) * (r.colEnd - r.colStart + 1)
		}
		if (this.lregion.isVisible()) {
			r = this.lregion;
			sum += (r.rowEnd - r.rowStart + 1) * (r.colEnd - r.colStart + 1)
		}
		if (this.ltregion.isVisible()) {
			r = this.ltregion;
			sum += (r.rowEnd - r.rowStart + 1) * (r.colEnd - r.colStart + 1)
		}
		return sum
	},
