	getSelectedRangeData : function (hd) {
		var ss = hd.sheet,
		sm = ss.getSelectionModel(),
		pos = sm.getMinMaxPos();
		var minX = pos.minrow,
		minY = pos.mincol,
		maxX = pos.maxrow,
		maxY = pos.maxcol;
		var sheetId = ss.getSheetId();
		var result = [];
		for (var i = minX; i <= maxX; i++) {
			for (var j = minY; j <= maxY; j++) {
				var cell = ss.getCellData(sheetId, i, j);
				var cellObj = {
					row : i,
					col : j,
					val : cell.data
				};
				result.push(cellObj)
			}
		}
		return result
	},
	getCellsComment : function (hd, sheetId) {
		var sheet = hd.sheet,
		store = hd.store,
		result = [];
		if (sheetId == null) {
			sheetId = sheet.getSheetId()
		}
		var coord = [[sheetId, 0, 0, 0, 0]];
		store.walkRange(coord, function (rd) {
			var row = rd.data.row,
			col = rd.data.col,
			currentSheetId = rd.data.sheet;
			if (0 !== row && 0 !== col && rd.data.json.comment) {
				var cell = store.getCellData(sheetId, row, col),
				data = cell.data;
				if (cell.comment) {
					if (rd.data.json.cal) {
						cell = SHEET_API.getCellValue(SHEET_API_HD, sheetId, row, col);
						data = cell.data
					}
					var cellObj = {
						sheetId : sheetId,
						x : row,
						y : col,
						comment : cell.comment,
						result : data
					};
					result.push(cellObj)
				}
			}
		}, this);
		return result
	},
